import React from 'react';
import { SafeAreaView, View} from 'react-native';
import {createStackNavigator} from '@react-navigation/stack'
import {NavigationContainer} from '@react-navigation/native'
import HomeScreen from '../screens/Home/HomeScreen';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import HomeSmile from '../ui/icons/HomeSmile';
import MeetingRoom from '../ui/icons/MeetingRoom';
import Check from '../ui/icons/Check';
import User from '../ui/icons/User';
import CheckActive from '../ui/icons/CheckActive';


const Stack = createStackNavigator();

const Tab = createBottomTabNavigator();


 function MyTabs() {
  return (
    <Tab.Navigator
      initialRouteName="Home"
      screenOptions={{
        tabBarActiveTintColor: 'black',
        tabBarStyle:{
          borderTopRightRadius: 18,
          borderTopLeftRadius: 18,
          paddingTop: 10,
          paddingBottom: 20,
          height: 71,
        }
      }}
    >
      <Tab.Screen
        name="Home"
        component={HomeScreen}
        options={{
          headerShown: false,
          tabBarLabel: 'Клуб',
          tabBarIcon: ({ color, size }) => (
            <HomeSmile color={color} />
          ),
        }}
      />
      <Tab.Screen
        name="Meet"
        component={HomeScreen}
        options={{
          headerShown: false,
          tabBarLabel: 'Встречи',
          tabBarIcon: ({ color, size }) => (
              <MeetingRoom color={color} />
            ),
        }}
      />
      <Tab.Screen
        name="Book"
        component={HomeScreen}
        options={{
          headerShown: false,
          tabBarLabel: 'Резерв',
          tabBarIcon: ({ color, size,focused}) => (
            focused ? <CheckActive /> : <Check color={color} />
          ),
          }}
      />
      <Tab.Screen
        name="User"
        component={HomeScreen}
        options={{
          headerShown: false,
          tabBarLabel: 'Профиль',
          tabBarIcon: ({ color, size }) => (
            <User color={color}/>
          ),
        }}
      />
    </Tab.Navigator>
  );
}

function MainNavigator() {
  return(
    <Stack.Navigator
    >
      <Stack.Screen name="Home" options={{ headerShown: false }}  component={MyTabs} />
    </Stack.Navigator>
  )
} 



 export default function AppContainer() {
  return(
        <NavigationContainer>
          <SafeAreaView style={{flex: 1}}>
            <View style={{flex: 1}}>
                  <MainNavigator />
            </View>
          </SafeAreaView>
      </NavigationContainer>
  )
} 


